import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import NavBar from './NavBar';
import './css/mypage.css';
import InputMask from 'react-input-mask';

export default function Mypage() {
    const [userInfo, setUserInfo] = useState(null);
    const [error, setError] = useState('');
    const [phone, setPhone] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const storedUser = localStorage.getItem('user');
        if (storedUser) {
            setUserInfo(JSON.parse(storedUser));
        }
        const fetchUserInfo = async () => {
            try {
                const response = await axios.post(
                    'http://localhost:8080/users/myPage', 
                    new URLSearchParams({
                      user_id: userInfo.user_id,
                    }),
                    {
                      headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
                      withCredentials: true,
                    }
                );

                if (response.status === 200) {
                    setUserInfo(response.data);
                }
            } catch (err) {
                setError('정보를 불러오는데 실패 했습니다.');
                console.error(err);
            }
        };

        fetchUserInfo();
    }, []);

    // userInfo.phone 값을 초기값으로 설정
    useEffect(() => {
        if (userInfo?.phone) {
        setPhone(userInfo.phone);
        }
    }, [userInfo]);

    const handleLogout = async () => {
        try {
            await axios.post('http://localhost:8080/users/logout', 
                new URLSearchParams({
                  user_id: userInfo.user_id,
                }),
                {
                  headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
                  withCredentials: true,
                }
            );

            // 로그아웃 성공 시 처리
            localStorage.removeItem('user');
            navigate('/login');
        } catch (err) {
            console.error('로그아웃 실패:', err);
            alert('로그아웃 중 오류가 발생했습니다.');
        }
    };

    return (
        <>
            <NavBar />
            <div className="mypage-wrapper">
                <div className="mypage-box">
                    {error && <p className="error-message">{error}</p>}
                    {userInfo && (
                        <h2 className="mypage-title">{userInfo.user_name}님 반갑습니다.</h2>
                    )}

                    {userInfo && (
                        <div class="form-group">
                            <label>연락처</label>
                            <div class="phone-input">
                                <InputMask
                                    mask="999-9999-9999"
                                    value={phone}
                                    defaultValue={userInfo.phone}
                                    onChange={(e) => setPhone(e.target.value)}
                                >
                                    {(inputProps) => <input type="text" {...inputProps} />}
                                </InputMask>
                            </div>
                        </div>
                    )}

{userInfo && (
                        <div class="form-group">
                            <label for="gender">성별</label>
                            <select id="gender">
                                <option value="male" selected={userInfo?.gender === '1'}>남성</option>
                                <option value="female" selected={userInfo?.gender === '2'}>여성</option>
                            </select>
                        </div>
                    )}

                    {userInfo && (
                        <div className="form-group">
                            <label htmlFor="age">나이</label>
                            <input type="number" name="age" defaultValue={userInfo.age} inputMode="numeric" pattern="\d*" min="0"/>
                        </div>
                    )}

                    {userInfo && (
                        <div className="form-group">
                            <label htmlFor="weight">체중 (kg)</label>
                            <input type="number" step="0.01" defaultValue={userInfo.user_weight} name="user_weight" inputMode="numeric" pattern="\d*" min="0" />
                        </div>
                    )}

                    {userInfo && (
                        <div className="form-group">
                            <label htmlFor="height">키 (cm)</label>
                            <input type="number" step="0.01" defaultValue={userInfo.height} name="height" inputMode="numeric" pattern="\d*" min="0" />
                        </div>
                    )}

                    {!userInfo && (
                        <p>정보를 불러오는 중...</p>
                    )}

                    <button onClick={() => navigate('/change-password')} className="mypage-button">
                        비밀번호 변경
                    </button>

                    <button onClick={handleLogout} className="mypage-button secondary">
                        로그아웃
                    </button>
                </div>
            </div>
        </>
    );
}
